import React from "react";
import { GoogleLogin } from "react-google-login";
import {} from "dotenv/config";

const LoginGoogle = () => {
  const onSuccess = (res) => {
    console.log("Login Sucess currentUSer " + res.profileObj);
  };
  const onFailure = () => {
    console.log("Login Fail");
  };
  // const value = process.env.REACT_APP_GOOGLE_O_AUTH_CLIENT_ID;
  const value =
    "729685557881-rb5lc7ump0sbqlntm1u12vhtq50jrch9.apps.googleusercontent.com";
  console.log(
    "Environemet variable" + process.env.REACT_APP_GOOGLE_O_AUTH_CLIENT_ID
  );
  console.log("CLient Id is " + value);
  return (
    <div>
      <GoogleLogin
        // clientId={process.env.REACT_APP_GOOGLE_O_AUTH_CLIENT_ID}
        clientId={value}
        buttonText="Login this shit"
        onSuccess={onSuccess}
        onFailure={onFailure}
        cookiePolicy={"single_host_origin"}
        className="mt-5"
        isSignedIn={true}
      ></GoogleLogin>
    </div>
  );
};
export default LoginGoogle;
